document.addEventListener("DOMContentLoaded",(()=>{const e=document.getElementById("hack-club-events");fetch("https://api.allorigins.win/get?url="+encodeURIComponent("https://events.hackclub.com/api/events/upcoming")).then((e=>{if(!e.ok)throw new Error("Network response was not ok");return e.json()})).then((n=>{e.innerHTML="<h2>Upcoming Hack Club Events</h2>";const t=JSON.parse(n.contents);console.log(t)})).catch((n=>{e.innerHTML=`<p>Error fetching events: ${n.message}</p>`}))}));